I often get questions about my skin, so I finally made a night time skin care routine which is quite practical and realistic to follow. For the video I used affordable products so it’s easy to access for everyone💕
What really helps is masking twice or thrice a week. Here I used the @farmskin_kr sheet mask in the Beet variant which is meant for brightening. These masks are available on @maccaron_beauty 🤩
.
